import React, { Component } from 'react';
import ItemDiscImg from '../../molecules/mainContent/ItemDiscImg';
import ItemTimeDetail from '../../molecules/mainContent/ItemTimeDetail';
import ItemPrice from '../../molecules/mainContent/ItemPrice';
import { ValueConsumer } from '../../../Context';
import './productItem.scss';

class ProductItem extends Component {
    render() {
        return (
            <section className='container'>
                <ValueConsumer >
                    {value => 
                        items.map((value, index) =>
                            <div key={index} className='item' id={'#item' + index}>
                                <ItemDiscImg item={value.item} />
                                <ItemTimeDetail name={value.item.name} weight={value.item.weight} />
                                <ItemPrice item={value.item} />
                            </div>
                        )
                    }
                </ValueConsumer>
            </section>
        )
    }
}

export default ProductItem
